void BundleReader::OpenPacked(const string file_path) {
	char header[HEADER_SIZE];

	//Read: File path
	n_file.open(file_path.c_str(), std::ofstream::binary);
	
	if(!n_file.is_open())
		throw BundleException(BundleError::CAN_NOT_OPEN, {file_path});
	
	// Read: Size
	n_file.seekg(0, n_file.end);
	n_size = n_file.tellg();
	n_file.seekg(0, n_file.beg);
	
	if(n_size <= 16)
		throw BundleException(BundleError::SIZE_TO_SMALL, {toString(n_size)});
	
	n_file.read(header, HEADER_SIZE);
	
	// Read: Signature
	n_signature = toUInteger(header);
	
	if(n_signature != BundleSignature::OLD && n_signature != BundleSignature::NEW)
		throw BundleException(BundleError::SIGNATURE, {toHex(n_signature)});
	
	// Read: Unzip size
	n_unzip_size = toUInteger(header + 4);
	
	// Read: Padding
	n_padding = toUInteger(header + 8);
}

void BundleReader::OpenUnPacked(const string file_path) {
	//Read: File path
	n_file.open(file_path.c_str(), std::ofstream::binary);
	
	if(!n_file.is_open())
		throw BundleException(BundleError::CAN_NOT_OPEN, {file_path});
	
	// Read: Size
	n_file.seekg(0, n_file.end);
	n_unzip_size = n_file.tellg();
	n_file.seekg(0, n_file.beg);
	
	if(n_unzip_size <= 256)
		throw BundleException(BundleError::SIZE_TO_SMALL, {toString(n_unzip_size)});
}

void BundleReader::Unpack(char* packed_data, char* unpacked_data) {
	unsigned int zlib_size;
	int new_pos, new_space, unzip_pos;
	
	// Calculate new position
	new_pos = 0;
	unzip_pos = 0;
	zlib_size = 0;
	new_space = n_size - HEADER_SIZE;
	
	// Read data
	n_file.read(packed_data, new_space);
	
	n_total_zlib = 0;
	while(new_space > new_pos) {
		// Found new zlib file
		n_total_zlib += 1;
		
		// Read the zlib file size
		zlib_size = toUInteger(packed_data + new_pos);
		new_pos += 4;
		
		if(zlib_size != 0x10000) {
			// Check if the zlib size is not to much
			if(new_pos + zlib_size > new_space)
				throw BundleException(BundleError::READ_TO_MUCH_DATA, {
					toString(new_pos), // Begin space
					toString(new_pos + zlib_size), // End space
					toString(new_space) // Total space available
				});
			
			//char* temp_data = unpacked_data + unzip_pos;
			unzip_pos += inflateZlib(packed_data + new_pos, unpacked_data + unzip_pos);
		}
		else
			n_total_zlib -= 1;
		
		// Test
		//char pack_data[ZLIB_CHUNK];
		//int pack_size = deflateZlib(temp_data, pack_data);
		//saveZlib(n_total_zlib, pack_data, pack_size);
		
		// Debug
		cout << "Zlib #" << toString(n_total_zlib) << endl;
		
		// Update position
		new_pos += zlib_size;
	}
}


