void BundleReader::Pack(char* unpacked_data, char* packed_data, unsigned int signature) {
	unsigned int unpacked_pos, zlib_size;
	
	//Init
	unpacked_pos = 0;
	n_size = 0;
	zlib_size = 0;
	
	// Read data
	n_file.read(unpacked_data, n_unzip_size);
	
	// Set signature , unzip and padding data
	toData(packed_data, signature);
	toData(packed_data + 4, n_unzip_size);
	toData(packed_data + 8, 0);
	n_size += 12;
	
	n_total_zlib = 0;
	while(unzipSpace() > unpacked_pos) {
		// Found new zlib file
		n_total_zlib += 1;
		
		// Check if the zlib size is not to much
		if(unpacked_pos + ZLIB_CHUNK > unzipSpace())
			throw BundleException(BundleError::READ_TO_MUCH_DATA, {
				toString(unpacked_pos), // Begin space
				toString(unpacked_pos + ZLIB_CHUNK), // End space
				toString(unzipSpace()) // Total space available
			});
		
		cout << "Zlib #" << toString(n_total_zlib) << " " << unpacked_pos << " - " << n_size << endl;
		
		zlib_size = deflateZlib(unpacked_data + unpacked_pos, packed_data + n_size + 4);
		
		toData(packed_data + n_size, zlib_size);
		
		n_size += zlib_size + 4;
		
		unpacked_pos += ZLIB_CHUNK;
	}
}

void BundleReader::saveFile(const string file_path, char* data, int size) {
	ofstream outfile;
	
	// Generate file
	outfile.open(file_path.c_str(), std::ofstream::binary);
	
	if(!outfile.is_open())
		throw BundleException(BundleError::CAN_NOT_OPEN, {file_path});
	
	// Write to outfile
	outfile.write(data, size);
	
	outfile.close();
}

void BundleReader::saveZlib(int nr, char* data, int size) {
	char intStr[4];
	string file_path;
	
	// Generate file path
	sprintf(intStr,"%d", nr);
	file_path = "file/zlib/" + string(intStr);
	
	saveFile(file_path, data, size);
}

unsigned int BundleReader::inflateZlib(char* source, char* dest) {
	int ret;
	z_stream strm;
	
	// Init
	strm.zalloc = Z_NULL;
	strm.zfree = Z_NULL;
	strm.opaque = Z_NULL;
	strm.avail_in = 0;
	strm.next_in = Z_NULL;
	
	ret = inflateInit(&strm);
	
	if(ret != Z_OK)
		throw BundleException(BundleError::INFLATE_ZLIB, {toHex(ret)});
	
	// Decompress
	strm.avail_in = ZLIB_CHUNK;
	strm.next_in = (unsigned char*)source;
	strm.avail_out = ZLIB_CHUNK;
	strm.next_out = (unsigned char*)dest;
	
	ret = inflate(&strm, Z_NO_FLUSH);
	
	if(ret != Z_OK && ret != Z_STREAM_END)
		throw BundleException(BundleError::INFLATE_ZLIB, {toString(ret)});
	
	// Clean
	(void)inflateEnd(&strm);
	
	return ZLIB_CHUNK - strm.avail_out;
}

unsigned int BundleReader::deflateZlib(char* source, char* dest) {
	int ret, flush;
	z_stream strm;

	// Init
	strm.zalloc = Z_NULL;
	strm.zfree = Z_NULL;
	strm.opaque = Z_NULL;
	
	ret = deflateInit(&strm, Z_DEFAULT_COMPRESSION);
	
	if (ret != Z_OK)
		throw BundleException(BundleError::DEFLATE_ZLIB, {toHex(ret)});
	
	// Compress
	strm.avail_in = ZLIB_CHUNK;
	strm.next_in = (unsigned char*)source;
	strm.avail_out = ZLIB_CHUNK;
	strm.next_out = (unsigned char*)dest;
	
	ret = deflate(&strm, Z_FINISH);    /* no bad return value */
	
	if(ret != Z_OK && ret != Z_STREAM_END)
		throw BundleException(BundleError::DEFLATE_ZLIB, {toHex(ret)});
	
	// Clean
	(void)deflateEnd(&strm);
	
    return ZLIB_CHUNK - strm.avail_out;
}

void BundleReader::LoadAdditionalDictionary()
{
	ifstream myFile("Name_dictionary.txt");
	if (myFile)
	{
		for (string line; getline(myFile, line);)
		{
			additionalfiles.emplace_back(line);
		}
	}

	ifstream myFile1("Ext_dictionary.txt");
	if (myFile1)
	{
		for (string line1; getline(myFile1, line1);)
		{
			additionalExts.emplace_back(line1);
		}
	}
}

void BundleReader::ExtractFileFromBundle(const char* name, char* unpacked_data, const char* fileType)
{
	vector<FileHashList> FileHashes;
	n_file.read(unpacked_data, n_unzip_size);
	int fileCount = toUInteger(unpacked_data);

	for (int i = 0; i < toUInteger(unpacked_data); i++)
	{
		unsigned long long fileTypeHash = toULongInteger((unpacked_data + 0x104) + (i * 0x14));
		unsigned long long fileNameHash = toULongInteger((unpacked_data + 0x104) + (i * 0x14) + 0x8);
		
		FileHashList currentHash;
		currentHash.hashFileName = fileNameHash;
		currentHash.hashFileType = fileTypeHash;
		FileHashes.push_back(currentHash);

		//cout << "File Number " << i << ":: " << toHex64(fileNameHash) << "." << toHex64(fileTypeHash) << endl;
	}
	cout << "Vector Size: " << FileHashes.size() << endl;

	uint64_t fileTypeHash = Hasher.MurmurHash64A(fileType, strlen(fileType), 0);
	unsigned long long prevSize = 0;

	for (int j = 0; j < FileHashes.size(); j++)
	{
		//if (FileHashes[j].hashFileType == fileTypeHash)
		//{
		if (j == 0)
		{
			cout << "File Type Match" << endl;
			int headerCount = toUInteger(((unpacked_data + 0x104) + (fileCount * 0x14)) + ((j * 0x10) + 0x10));
			int fileSize = toUInteger(((unpacked_data + 0x104) + (fileCount * 0x14)) + ((j * 0x10) + 0x1C));

			if (FileHashes[j].hashFileType == fileTypeHash)
			{
				cout << "HeaderCount: " << headerCount << " FileSize: " << fileSize << endl;
			}

			prevSize += (fileSize + 0x14);
		}
		else
		{
			int headerCount = toUInteger(((unpacked_data + 0x104) + (fileCount * 0x14) + prevSize) + ((j * 0x10) + 0x10));
			unsigned long long fileSize = toUInteger(((unpacked_data + 0x104) + (fileCount * 0x14) + prevSize) + ((j * 0x10) + 0x1C));

			if (FileHashes[j].hashFileType == fileTypeHash)
			{
				cout << "HeaderCount: " << headerCount << " FileSize: " << fileSize << endl;
				
				string dumpName = to_string(FileHashes[j].hashFileName);
				cout << dumpName << endl;
				ofstream fout;
				fout.open(dumpName.c_str(), ios::binary);
				fout.write((((unpacked_data + 0x104) + (fileCount * 0x14) + prevSize) + ((j * 0x10) + 0x30)), fileSize);
				fout.close();
			}
			if (fileSize == 3283516)
			{
				fileSize -= 0x60000;
			}
			prevSize += (fileSize + 0x14);
		}
			/*
			for (int l = 0; l < headerCount; l++)
			{
				int languageId = toUInteger((unpacked_data + 0x104 + (fileCount * 0x14)) + (j * 0x10) + l);
				int size = toUInteger((unpacked_data + 0x104 + (fileCount * 0x14)) + (j * 0x10) + (l * 0x4));
				cout << "langID: " << languageId << "fileSize: " << size << endl;
			}
			*/
		//}
	}
}

void BundleReader::LookupHashInput(uint64_t inputHash)
{
	printf("%08llX\n", inputHash);
	LoadAdditionalDictionary();
	int knowntypesLen = sizeof(knowntypes) / sizeof(knowntypes[0]);
	int knownfilesLen = sizeof(knownfiles) / sizeof(knownfiles[0]);

	for (int i = 0; i < knowntypesLen; i++)
	{
		uint64_t tempHash = Hasher.MurmurHash64A(knowntypes[i].c_str(), knowntypes[i].length(), 0);
		if (tempHash == inputHash)
		{
			printf("Found: %s\n", knowntypes[i].c_str());
			return;
		}
	}
	if (additionalExts.size() > 0)
	{
		for (int i = 0; i < additionalExts.size(); i++)
		{
			uint64_t tempHash = Hasher.MurmurHash64A(additionalExts.at(i).c_str(), additionalExts.at(i).length(), 0);
			if (tempHash == inputHash)
			{
				printf("Found: %s\n", additionalExts.at(i).c_str());
				return;
			}
		}
	}

	for (int i = 0; i < knownfilesLen; i++)
	{
		uint64_t tempHash = Hasher.MurmurHash64A(knownfiles[i].c_str(), knownfiles[i].length(), 0);
		if (tempHash == inputHash)
		{
			printf("Found: %s\n", knownfiles[i].c_str());
			return;
		}
	}
	if (additionalfiles.size() > 0)
	{
		for (int i = 0; i < additionalfiles.size(); i++)
		{
			uint64_t tempHash = Hasher.MurmurHash64A(additionalfiles.at(i).c_str(), additionalfiles.at(i).length(), 0);
			if (tempHash == inputHash)
			{
				printf("Found: %s\n", additionalfiles.at(i).c_str());
				return;
			}
		}
	}
}

