			if (additionalExts.size() > 0)
			{
				for (int kkk = 0; kkk < additionalExts.size(); kkk++)
				{
					uint64_t tempHash = Hasher.MurmurHash64A(additionalExts.at(kkk).c_str(), additionalExts.at(kkk).length(), 0);
					if (tempHash == fileTypeHash)
					{
						foundExtraData = true;
						foundExtraIndex = kkk;
					}
				}
			}

			if (foundExtraData)
			{
				myHashList.hashTypeList.emplace_back(additionalExts.at(foundExtraIndex).c_str());
			}
			else
			{
				myHashList.hashTypeList.emplace_back(to_string(fileTypeHash));
			}
